import React from "react";

const ColorBlock = ({ colorVal, hexVal }) => {
  return (
    <section className="colorSquare" style={{ backgroundColor: colorVal }}>
      <p>{colorVal ? colorVal : "No Color Value"}</p><br></br>
      <p>{hexVal ? hexVal : null}</p>
    </section>
  );
};

ColorBlock.defaultProps = {
  colorVal: "Empty Color Value",
};
export default ColorBlock;
